import React from 'react'
import imagenes from "../assets/imagenes";

function Senderismo() {
    return (
      <div>        
        <h3 className="text-center">Senderismo</h3> 
        <img class="center" src={imagenes.img8}/>
      </div>
    );
  }

  export default Senderismo;
